import React, {Component} from 'react';

import {Link} from 'react-router-dom';
import axios from 'axios';
import './css/Login.css';
import {Dispatcher, Constants} from '../flux';

export default class Login extends Component {
  constructor(props) {
    super(props);

    this.state = {
      userSecret: '',
      userName: '',
      mobile: '',
      password: '',
      user: 'admin',
    };
  }
  componentDidMount() {
    console.log('OK');
    Dispatcher.dispatch({
      actionType: Constants.USER,
      payload: 'admin-default',
    });
  }

  inputHandle = event => {
    console.log('OK');
    const {name, value} = event.target;
    this.setState({[name]: value});
  };

  onSubmit = event => {
    event.preventDefault();
    console.log('user', this.state.user);
    Dispatcher.dispatch({
      actionType: Constants.USER,
      payload: this.state.user,
    });
    if (this.state.user === 'admin') {
      if (
        `${this.state.userName}${this.state.mobile}` === `admin666` &&
        this.state.password === 'admin'
      ) {
        this.props.history.push('/');
      } else {
        alert('Please Try after some time');
      }
    } else if (this.state.user === 'customer') {
      const user = {
        secretUsername: this.state.userSecret,
        userName: this.state.userName,
        userMobile: this.state.mobile,
        userPassword: this.state.password,
      };
      const userStore = {
        secretUsername: this.state.userSecret,
        userName: this.state.userName,
        userMobile: this.state.mobile,
        userPassword: this.state.password,
      };
      axios
        .post('http://localhost:5000/api/customer/login', user)
        .then(responce => responce.data)
        .then(result => {
          console.log(result);
          if (result.length > 0) {
            Dispatcher.dispatch({
              actionType: Constants.STORE,
              payload: userStore,
            });
            alert('Login Successful');
            this.props.history.push('/');
          } else {
            console.log('Login Failed');
          }
        });
    } else if (this.state.user === 'supplier') {
      const user = {
        secretSupplierName: this.state.userSecret,
        supplierName: this.state.userName,
        supplierMobile: this.state.mobile,
        supplierPassword: this.state.password,
      };
      const userStore = {
        secretUsername: this.state.userSecret,
        userName: this.state.userName,
        userMobile: this.state.mobile,
        userPassword: this.state.password,
      };
      axios
        .post('http://localhost:5000/api/supplier/login', user)
        .then(responce => responce.data)
        .then(result => {
          console.log(result);
          if (result.length > 0) {
            Dispatcher.dispatch({
              actionType: Constants.STORE,
              payload: userStore,
            });
            alert('Login Successful');
            this.props.history.push('/');
          } else {
            console.log('Login Failed');
          }
        });
    } else if (this.state.user === 'farmer') {
      const user = {
        secretFarmerName: this.state.userSecret,
        farmerName: this.state.userName,
        farmerMobile: this.state.mobile,
        farmerPassword: this.state.password,
      };
      const userStore = {
        secretUsername: this.state.userSecret,
        userName: this.state.userName,
        userMobile: this.state.mobile,
        userPassword: this.state.password,
      };
      axios
        .post('http://localhost:5000/api/farmer/login', user)
        .then(responce => responce.data)
        .then(result => {
          console.log(result);
          if (result.length > 0) {
            Dispatcher.dispatch({
              actionType: Constants.STORE,
              payload: userStore,
            });
            alert('Login Successful');
            this.props.history.push('/');
          } else {
            console.log('Login Failed');
          }
        });
    }
  };

  render() {
    return (
      <div className="row d-flex align-items-center justify-content-center h-100 w-100 vertical-center">
        <div className="col-3 col-sm-0" />
        <div className="col-6 col-sm-0">
          <div className="card p-2">
            <div className="row d-flex justify-content-center">
              <img
                src="data:image/jpeg;base64,"
                alt="com logo"
                height="200"
                width="200"
              />
            </div>
            <form method="POST">
              <div className="form-group ml-2 mr-2">
                <label htmlFor="userSecret" className="ml-2">
                  Secret Name
                </label>
                <input
                  type="text"
                  className="form-control"
                  id="userSecret"
                  name="userSecret"
                  onChange={this.inputHandle}
                  placeholder="Enter user Secret"
                  value={this.state.userSecret}
                />
              </div>
              <div className="form-group ml-2 mr-2">
                <label htmlFor="userName" className="ml-2">
                  User Name
                </label>
                <input
                  type="text"
                  className="form-control"
                  id="userName"
                  name="userName"
                  onChange={this.inputHandle}
                  placeholder="Enter userName"
                />
              </div>
              <div className="form-group ml-2 mr-2">
                <label htmlFor="userName" className="ml-2">
                  Mobile Number
                </label>
                <input
                  type="mobile"
                  className="form-control"
                  id="mobile"
                  name="mobile"
                  onChange={this.inputHandle}
                  placeholder="Enter Mobile number"
                />
              </div>
              <div className="form-group ml-2 mr-2">
                <label htmlFor="password" className="ml-2">
                  Password
                </label>
                <input
                  type="password"
                  className="form-control"
                  id="password"
                  name="password"
                  onChange={this.inputHandle}
                  placeholder="Password"
                />
              </div>
              <div className="form-group ml-2 mr-2">
                <label htmlFor="exampleFormControlSelect1" className="ml-2">
                  Select User Type
                </label>
                <select
                  name="user"
                  className="form-control"
                  onChange={this.inputHandle}
                  id="exampleFormControlSelect1">
                  <option value="admin">Admin</option>
                  <option value="farmer">Farmer</option>
                  <option value="supplier">Supplier</option>
                  <option value="customer">Customer</option>
                </select>
              </div>
            </form>
            <div className="row">
              <div className="col-12 d-flex justify-content-center">
                <button
                  type="submit"
                  onClick={this.onSubmit}
                  className="m-2 d-flex justify-content-center btn btn-primary mb-3">
                  Submit
                </button>
              </div>
            </div>
            <Link to="/register" className="m-2 d-flex justify-content-center">
              Not Registered! Please register
            </Link>
          </div>
        </div>
        <div className="col-3 col-sm-0" />
      </div>
    );
  }
}
